function reset() {
    this.tileSize = 20;
    this.tileDims = this.getBounds().extent()
        .griddedBy(lively.pt(this.tileSize, this.tileSize))
        .scaleBy(1 / this.tileSize);
    this.resetCanvas();
    this.tiles = [];
    this.edges = [];
    for (var x = 0; x < this.tileDims.x; x++) {
        this.tiles[x] = [];
        for (var y = 0; y < this.tileDims.y; y++) {
            var tile = [0, Math.random(), Math.random()];
            this.tiles[x][y] = tile;
            if (x < this.tileDims.x - 1) {
                this.edges.push({from: x+","+y, to: (x+1)+","+y, val: tile[1]});
            }
            if (y < this.tileDims.y - 1) {
                this.edges.push({from: x+","+y, to: x+","+(y+1), val: tile[2]});
            }
        }
    }
    this.vset = {"0,0": true};
    this.edges = this.edges.sortBy(function(e) { return e.val; });
    this.sourceAndSink();
}

