function update(pt) {
    var tile = pt.scaleBy(this.tileSize)
                 .extent(lively.pt(this.tileSize - 1, this.tileSize - 1));
    var ctx = this.getContext('2d');
    ctx.fillStyle = "#303030";
    ctx.fillRect(tile.x, tile.y, tile.width, tile.height);
    ctx.fillStyle = "#e0e0e0";
    var tileType = this.tiles[pt.x][pt.y][0];
    if (tileType & 0x1) {
        var inner = tile.insetBy(2).withLeftCenter(lively.pt(tile.x,0));
        ctx.fillRect(inner.x, inner.y, inner.width, inner.height);
    }
    if (tileType & 0x2) {
        var inner = tile.insetBy(2).withTopCenter(lively.pt(0,tile.y));
        ctx.fillRect(inner.x, inner.y, inner.width, inner.height);
    }
    if (tileType & 0x4) {
        var inner = tile.insetBy(2).withWidth(tile.width - 1);
        ctx.fillRect(inner.x, inner.y, inner.width, inner.height);
    }
    if (tileType & 0x8) {
        var inner = tile.insetBy(2).withHeight(tile.height - 1);
        ctx.fillRect(inner.x, inner.y, inner.width, inner.height);
    }
}

