function step() {
    var e;
    for (var i = 0; i < this.edges.length; i++) {
        e = this.edges[i];
        if (this.vset[e.from] && !this.vset[e.to]) break;
        if (this.vset[e.to] && !this.vset[e.from]) break;
    }
    if (i == this.edges.length) return this.stopStepping();
    this.edges.remove(e);
    this.vset[e.from] = true;
    this.vset[e.to] = true;
    var from = e.from.split(",").map(function(c) {return +c});
    var to = e.to.split(",").map(function(c) {return +c});
    if (from[0] == to[0]) {
        this.tiles[from[0]][from[1]][0] |= 0x8;
        this.tiles[to[0]][to[1]][0] |= 0x2;
    } else {
        this.tiles[from[0]][from[1]][0] |= 0x4;
        this.tiles[to[0]][to[1]][0] |= 0x1;
    }
    this.update(lively.pt(from[0], from[1]));
    this.update(lively.pt(to[0], to[1]));
}

