function updateOld() {
    var ts = this.tileSize;
    var ctx = this.getContext('2d');
    for (var x = 0; x < this.tileDims.x; x++) {
        for (var y = 0; y < this.tileDims.y; y++) {
            var c = this.tiles[x][y][0];
            ctx.fillStyle = "#" + Color.rgb(c,c,c).toHexString();
            ctx.fillRect(x * ts, y * ts, x * ts + ts, y * ts + ts);
        }
    }
}

408.source:
function resetCanvas() {
    var ctx = this.getContext('2d');
    ctx.fillStyle = "#e0e0e0";
    ctx.fillRect(0, 0, this.getBounds().right(), this.getBounds().bottom());
    ctx.fillStyle = "#303030";
    ctx.fillRect(0, 0, this.tileDims.x * this.tileSize,
                       this.tileDims.y * this.tileSize);
}

411.source:
function sourceAndSink() {
    this.tiles[0][0][0] = 1;
    this.update(lively.pt(0,0));
    this.tiles[this.tileDims.x - 1][this.tileDims.y - 1][0] = 4;
    this.update(this.tileDims.subXY(1,1));
}

